.cucumber-react .cucumber-status--passed {
  color: #2CB14A;
}

}
.cucumber-react .cucumber-status--pending {
  color: #FFAD33;
}
.cucumber-react .cucumber-status--undefined {
  color: #FFAD33;
}
.cucumber-react .cucumber-status--ambiguous {
  color: #F4EBFD;
}
.cucumber-react .cucumber-status--failed {
  color: #BB0000;
}
.cucumber-react .cucumber-status--unknown {
  color: #B6BECB;
}
.cucumber-react h1, .cucumber-react h2, .cucumber-react h3 {
  padding: 0;
  margin: 0;
}
.cucumber-react a {
  color: inherit;
}

  background: #fff;
  overflow-x: hidden;
}
.cucumber-react .cucumber-title {
  margin-top: 0.3em;

  display: inline-block;
}
.cucumber-react .cucumber-title__keyword {
  font-weight: bold;
}
.cucumber-react .cucumber-title__text {
  font-weight: normal;
}
.cucumber-react .cucumber-tags {
  padding: 0;
  margin-bottom: 0;
}
.cucumber-react .cucumber-tags .cucumber-tag {
  display: inline;
  list-style-type: none;
  padding: 4px 8px 4px 8px;
  margin-right: 6px;
  background-color: #FFFFFF;
  border-radius: 6px;
}
.cucumber-react .cucumber-feature__icon {
  padding-top: 0.35em;
  padding-right: 0.5em;
}
.cucumber-react .cucumber-description,
.cucumber-react .cucumber-children {
  margin-left: 1em;

.cucumber-react .cucumber-feature,
.cucumber-react .cucumber-rule,

.cucumber-react .cucumber-steps {

}

  display: flex;
  align-items: center;
  margin-top: 0.3em;
}
.cucumber-react .cucumber-anchor__link {
  opacity: 0;
  transition: all 0.35s ease-in-out;
  position: absolute;
  left: -20px;
  display: flex;
  align-items: center;
}
.cucumber-react .cucumber-anchor__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-anchor:hover a {
  opacity: 1;
  width: max-content;
  transition: all 0.35s ease-in-out;
}
.cucumber-react .cucumber-anchor > * {
  height: 100%;
  margin-top: 0px;
}

.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);
  font: 11px "Open Sans", sans-serif;
  margin-bottom: 1em;
}
.cucumber-report-header > * {
  padding: 1em;
}
.cucumber-report-header .cucumber-status-filter {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-status-filter table {
  width: 100%;
}
.cucumber-report-header .cucumber-execution-data {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-search-bar {
  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {
  height: 2.2em;
  padding-left: 0.6em;
  padding-right: 0.6em;
}
.cucumber-report-header .cucumber-search-bar p.help {
  font-size: 80%;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {
  display: inline;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li {
  list-style-type: none;
  display: inline-block;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {
  display: inline-block;
  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }
}
.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

tup, manage leads, opportunities \u0026 accounts, create custom dashboards \u0026 reports, deliver social and email support, save time with customer service tools. Easily route the right customer service request to the proper agent and manage your knowledge base all in the CRM system.*********\ntxt-gray-light offset-top-10       *********Know every contact in your key accounts. Get a complete view of your customers, including activity history, key contacts, customer communications, and discussions with your co-workers. Customers matter, but spreadsheets, emails, and sticky notes are a hard way to manage them. CRM centralizes your data so you can manage the sales process, help customers faster, and market smarter. With the CRM tool, it is easy to segment and slice and dice your customers or prospects and convert more leads to sales.*********\ntxt-gray-lighter offset-top-75 offset-md-top-87       *********Add as many employees as you wish to the CRM and automate your business like never before. Please take a closer look at what CRM is and how it helps find, win, and keep customers. Manage your sales pipeline and speed up your closing time with Free CRM. Interactions tracked in the CRM give you a bird\u0027s eye view, and deals are displayed on the dashboard for total visibility into everyone\u0027s progress and obstacles. Enterprise-level security and ongoing support to help you grow. Small businesses can grow faster with all of the tools to fill the sales pipeline through smarter marketing, improved sales productivity, and customer service.*********\noffset-top-23       *********Our company offers professional Free CRM services to boost sales and automate marketing and get more customers. CRM helps your whole team organize and keep track of all of your important corporate data.*********\noffset-top-23       *********Try our mobile CRM applications for Android and iPhone and get your data on mobile on the web. Download and install our CRM apps and log in from anywhere to access your CRM data.*********\noffset-top-22       *********Sales CRM\nHIPAA Medical CRM\nDental CRM\nAutomotive CRM\nCall Center CRM\nInsurance CRM\nReal Estate CRM\nProfessional Services CRM\nContractor Builder CRM\nIndependent Sales CRM\nNPO Nonprofit CRM\nNGO Nongovernment CRM\nWealth \u0026 Finance CRM\nHospitality CRM\nRestaurant CRM\n*********\nprivacy       *********FreeCRM.com © 2021 - Privacy Policy - Terms of Use*********\niTunes       *********https://www.freecrm.com/images/Itunes.png*********\nAndroid       *********https://www.freecrm.com/images/Android.png*********\nfree crm customer california       *********https://www.freecrm.com/images/index-14-150x150.png*********\nfree crm customer jackson       *********https://www.freecrm.com/images/index-12-150x150.png*********\nfree crm customer 42 vantage       *********https://www.freecrm.com/images/index-10-150x150.png*********\nfree crm customer original       *********https://www.freecrm.com/images/index-11-150x150.png*********\nfree crm customer lakewoods       *********https://www.freecrm.com/images/index-12-150x150.png*********\nfree crm customer household       *********https://www.freecrm.com/images/index-13-150x150.png*********\nfree crm customer california       *********https://www.freecrm.com/images/index-14-150x150.png*********\nfree crm customer jackson       *********https://www.freecrm.com/images/index-12-150x150.png*********\nfree crm customer 42 vantage       *********https://www.freecrm.com/images/index-10-150x150.png*********\nfree crm customer original       *********https://www.freecrm.com/images/index-11-150x150.png*********\nGet it on Google Play       *********https://play.google.com/intl/en_us/badges/static/images/badges/en_badge_web_generic.png*********\nDownload on the App Store       *********https://tools.applemediaservices.com/api/badges/download-on-the-app-store/black/en-US?size\u003d250x83\u0026h\u003d95ead71555e15d4e25dc1db901e9e7b4*********\n","mediaType":"text/x.cuc ommunications, and discussions with your co-workers. Customers matter, but spreadsheets, emails, and sticky notes are a hard way to manage them. CRM centralizes your data so you can manage the sales process, help customers faster, and market smarter. With the CRM tool, it is easy to segment and slice and dice your customers or prospects and convert more leads to sales.*********\ntxt-gray-lighter offset-top-75 offset-md-top-87       *********Add as many employees as you wish to the CRM and automate your business like never before. Please take a closer look at what CRM is and how it helps find, win, and keep customers. Manage your sales pipeline and speed up your closing time with Free CRM. Interactions tracked in the CRM give you a bird\u0027s eye view, and deals are displayed on the dashboard for total visibility into everyone\u0027s progress and obstacles. Enterprise-level security and ongoing support to help you grow. Small businesses can grow faster with all of the tools to fill the sales pipeline through smarter marketing, improved sales productivity, and customer service.*********\noffset-top-23       *********Our company offers professional Free CRM services to boost sales and automate marketing and get more customers. CRM helps your whole team organize and keep track of all of your important corporate data.*********\noffset-top-23       *********Try our mobile CRM applications for Android and iPhone and get your data on mobile on the web. Download and install our CRM apps and log in from anywhere to access your CRM data.*********\noffset-top-22       *********Sales CRM\nHIPAA Medical CRM\nDental CRM\nAutomotive CRM\nCall Center CRM\nInsurance CRM\nReal Estate CRM\nProfessional Services CRM\nContractor Builder CRM\nIndependent Sales CRM\nNPO Nonprofit CRM\nNGO Nongovernment CRM\nWealth \u0026 Finance CRM\nHospitality CRM\nRestaurant CRM\n*********\nprivacy       *********FreeCRM.com © 2021 - Privacy Policy - Terms of Use*********\niTunes       *********https:/
